        "modified": "2019-08-02T05:45:11",
        "modified_gmt": "2019-08-02T05:45:11",
        "slug": "step-1-why-you-should-create-a-budget",
        "status": "publish",
        "type": "sfwd-lessons",
        "link": "https://community.tala.test/course/budgeting-101/lessons/step-1-why-you-should-create-a-budget/",
        "title": {
            "rendered": "Step 1: Why you should create a budget"
        },
        "content": {
            "rendered": "\n<p>Rent, school fees, food, clothes, phone, transportation fees‚Ä¶ life costs a lot of money!&nbsp;<br></p>\n\n\n\n<p>Balancing your income and your living costs can be exhausting and stressful. You want to make good choices that enable you to live your life today, while preparing for your future. Making a budget is a great first step in understanding and taking control of your finances. Taking this first step will alleviate some stress, giving you the knowledge to make good choices and save for the future.&nbsp;<br></p>\n\n\n\n<p>Here are some reasons why people create budgets:&nbsp;</p>\n\n\n\n<ul><li>Understand day-to-day needs</li><li>Stop living hand-to-mouth&nbsp;</li><li>Pay off debt</li><li>Save up for large purchases, such as a car, business or plot</li></ul>\n\n\n\n<h3>Why do you want to create a budget? </h3>\n\n\n\n<p>Tell us in the comments below! </p>\n",
            "protected": false
        },
